import ExpenseItem from './components/ExpenseItem'

function App() {

  let date = "1";
  let title = "2";
  let amount = "3";

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem expenseDate={date} expenseTitle={title} expenseAmount={amount}/>
    </div>
  );
}

export default App;
